5d9e56e6aff3ea0d1329d0eb61bc82bc40366556.source:
query LogInEmail($email: EmailAddress!, $password: String!) {
  logInEmail(email: $email, password: $password) {
    __typename
    ...LoginResponse
  }
}
fragment LoginResponse on AuthenticationResponse {
  __typename
  code
  token
  message
  success
  user {
    __typename
    ...UserDetails
  }
}
fragment UserDetails on User {
  __typename
  prefix
  givenName
  middleName
  lastName
  role
}

