mutation Register($user: UserRegisterationInput!) {
  register(user: $user) {
    __typename
    code
    token
    message
    success
    user {
      __typename
      ...UserDetails
    }
  }
}
fragment UserDetails on User {
  __typename
  prefix
  givenName
  middleName
  lastName
  role
}
